Sorry tadi saya kurang memahami statementnya kecepetan reply. Jadi statement ini ada beberapa pemahaman. Most likely yang dibilang bosnya mas Enggar bener.

Pemahaman 1: Selama bentuknya masih IQueryable, semua LINQ method yang dilakukan cuma mengubah IQueryable itu jadi IQueryable baru. Costnya close to zero. (statement si bos benar)

Pemahaman 2: Linq method bisa ditambahkan sebelum IQueryable kita enumerate atau bisa ditambahkan setelah kita enumerate. Kadang lebih baik to keep it IQueryable, kadang lebih baik enumerate dulu sebelum operation lain. Masing-masing ada plus minusnya. Pembahasannya nanti setelah ini.

Pemahaman 3: Terkadang ada developer baru yang keep 1 IQueryable untuk di-enumerate beberapa kali. Misal:

