share dikit soal C# 9.0. sekarang kita bisa menulis
```if (!string.IsNullOrEmpty(s)) {
}
``` 
pakai relational pattern menjadi:
```if (s is { Length: > 0 }) {
}

```dan dengan cara yang sama sekarang ngecek list is not null or empty jadi gampang:
```if (list is { Count: > 0 }) {
}```

atau buat yang prefer syntax yang lebih english bisa begini:
```if (s is not null and not "") {
}

if (list is not null and { Count: not 0 }) {
}```

lebih mirip graphql sih. soalnya ada recursive patterns:
```if (obj is Foo {
    IsDeleted: false,
    Value: {} val
} foo && val switch {
    string s => s is not null and not "",
    int i => i is not null and >= 0 and < 9999,
    _ => false
}) {
    ...
}```

btw pattern cheat sheet buat yang belum pernah mengenal:

```// cek apakah obj bisa cast ke string (dan tidak null)
if (obj is string)

// cek apakah obj bisa cast ke string. kalau bisa, declare local s
if (obj is string s)

// cek apakah s tidak null (empty recursive pattern)
if (s is {})

// cek apakah s tidak null dan property Lengthnya > 0 (recursive pattern)
if (s is { Length: > 0 })

// cek apakah x tidak null dan x.Value bisa cast ke Foo. kalau bisa, declare local foo
if (x is { Value: Foo foo })

// cek apakah x tidak null dan x.Value tidak null (tanpa cast)
if (x is { Value: {} val })

// cek apakah x tidak null, tapi x.Value tidak perlu dicek, langsung declare local val tanpa cast & pattern matching
if (x is { Value: var val })

// y > 0 && y < 10 (relational pattern)
if (y is > 0 and < 10)```

