mungkin untuk lebih jelasnya saya kasih contoh OOP. misal kita punya entity begini:

```public class Student {
    public int Id { get; set; }
    public string Name { get; set; }
    public bool HasGraduated { get; set; }
}

```dengan OOP, kita bisa bikin domain modelnya jadi begini:

```public abstract record StudentBase(int Id, string Name);
public record CurrentStudent(int Id, string Name, ImmutableArray<string> EnrolledCourses) : StudentBase(Id, Name) {
    public CurrentStudent EnrollToCourse(string course) { ... }
}
public record GraduatedStudent(int Id, string Name) : StudentBase(Id, Name) {
    public decimal GetGPA() { ... }
}

```jadi untuk setiap operation yang spesifik ke jenis student tertentu, tinggal kita tambahkan ke model yang relevan. nggak perlu pake if/switch condition berdasarkan HasGraduated
